import React from "react";
import { useSelector } from "react-redux";

type Iprops = {
  title?: string;
  questionCount?: number | undefined;
};
type Ireducers = {
  answeredquestions: Array<Tquestions>;
  data: Array<Tquestion>;
};

type Tquestions = {
  question: string;
  options: string[];
  answer: string;
};
type Tquestion = {
  title: string;
  icon: string;
  questions: Array<Tquestions>;
};

const ResultComp = ({ title, questionCount }: Iprops) => {
  const cartItems = useSelector((state: Ireducers) => state.answeredquestions);
  const totalQ = questionCount;
  const totalqronganswerfed = cartItems.length;
  const scored = totalQ ?? -totalqronganswerfed;
  console.log("cartItems", totalQ ?? 0 - totalqronganswerfed);
  return (
    <>
      <div>
        <div>
          <div>{title}</div>
          <h1>Quiz Completed </h1>
          <h2>You Scored ...</h2>
        </div>
        <div>
          <h1>{scored}</h1>
          <h2>Out of {questionCount}</h2>
        </div>
      </div>
    </>
  );
};

export default ResultComp;
